De tiener Robbie Mueller, die een moorddadige reputatie heeft voor het bovennatuurlijke, heeft zijn oog laten vallen op de dochter van de lokale politie-rechercheur. Bezorgd als hij is besluit de agent de hulp in te roepen van een mysterieuze man, pater Henry Polotti, om de waarheid te achterhalen. Maar wanneer ze zich verdiepen in Robbie ontstaat er een gevaarlijk kat-en-muisspel, nog voordat ze het ware geheim onthullen.


